import React from "react";

const Card = (props) => {
    return (
        <>
            <div className="mainCard">
                <img src={props.image} ></img>
                <div className="overlay"></div>
                <div className="detail">
                    <p>{props.name}</p>
                </div>
            </div>
            
        </>
    );
}
export default Card;
